import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useEffect, useState } from 'react'


import Home from './pages/Home'

function App() {
  const  [name, checkName] = useState(0);

  useEffect(() => {
    fetch('/name').then(res => res.json()).then(data => {
      checkName(data.name);
    });
  }, []);

  return (
    <Container>
      <Row style={{justifyContent: "center", margin: 0}}>
          <Col style={{maxWidth: "fit-content", margin: 0}}>
          Your Input <br />
          Request to Server
              <form onSubmit={this.handleSubmit}>
                      <input type="name" value={this.state.value} onChange={this.handleChange} name="name" placeholder="Enter name"/>
              </form>
          </Col>
          <Col style={{maxWidth: "fit-content", margin: 0}}>
          <br />
          Response from Server<br />
              <input type="ans" onChange={this.handleChange2} name="ans"/>
          </Col>
      </Row>
    </Container>
  );
}

export default App;
